import React, { useState } from "react";

const App = () => {
  const [item, setItem] = useState();

  const itemEvent = (event) => {
    setItem(event.target.value);
  };

  return (
    <div>
    <div>
      <h1> ToDo List </h1>
      <br/>
      <input type="text" placeholder="Add An Items" onChange={itemEvent} />
      <button> + </button>

        <ul type="none">
        <li> {item} </li>
      </ul>
      </div>
    </div>
  );
};

export default App;
